import React, { useEffect, useState } from "react";

const Log = () => {
  const [logs, setLogs] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/api/logs")
      .then((res) => res.json())
      .then((data) => setLogs(data))
      .catch((err) => console.error("Failed to fetch logs:", err));
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 p-6">
      <h1 className="text-3xl font-bold text-center mb-6 text-teal-800">Logi</h1>
      <div className="overflow-x-auto">
        <table className="min-w-full bg-white shadow-md rounded">
          <thead>
            <tr className="bg-teal-600 text-white">
              <th className="px-4 py-2">Log ID</th>
              <th className="px-4 py-2">Voter ID</th>
              <th className="px-4 py-2">Old Value</th>
              <th className="px-4 py-2">New Value</th>
              <th className="px-4 py-2">Change Time</th>
            </tr>
          </thead>
          <tbody>
            {logs.map((log) => (
              <tr key={log.log_id} className="text-center border-b">
                <td className="px-4 py-2">{log.log_id}</td>
                <td className="px-4 py-2">{log.voter_id}</td>
                <td className="px-4 py-2">{log.old_value}</td>
                <td className="px-4 py-2">{log.new_value}</td>
                <td className="px-4 py-2">{new Date(log.change_time).toLocaleString()}</td>
              </tr>
            ))}
            {logs.length === 0 && (
              <tr>
                <td colSpan="5" className="text-center text-gray-500 py-4">
                  Logikirjeid ei leitud.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Log;
